{
    "Comment": "Taceviewer_dummy",
    "StartAt": "START Taceviewer_dummy extracts",
    "States": {
        "START Taceviewer_dummy extracts": {
            "Type": "Pass",
            "InputPath": "$",
            "OutputPath": "$",
            "Next": "CHECK Datalake_SAM_ServiceRegion_ZipCode"
        },
        "CHECK Datalake_SAM_ServiceRegion_ZipCode": {
            "Type": "Choice",
            "Choices": [
                {
                    "Variable": "$.INPUT.Datalake_SAM_ServiceRegion_ZipCode",
                    "StringEquals": "Y",
                    "Next": "SKIP Datalake_SAM_ServiceRegion_ZipCode"
                }
            ],
            "Default": "EXTRACT Datalake_SAM_ServiceRegion_ZipCode"
        },
        "EXTRACT Datalake_SAM_ServiceRegion_ZipCode": {
            "Type": "Task",
            "Resource": "arn:aws:states:::glue:startJobRun.sync",
            "Parameters": {
                "JobName": "us-prod-daasbatchextract",
                "Arguments": {
                    "--application_name": "Taceviewer_dummy",
                    "--extract_number": "1"
                }
            },
            "End": true
        },
        "SKIP Datalake_SAM_ServiceRegion_ZipCode": {
            "Type": "Pass",
            "End": true
        }
    }
}
